import React, { useState } from 'react';
import { useAppContext } from '../../context/AppContext';
import './Aircraft.css';

const Aircraft = () => {
  const { aircraftList, setAircraftList } = useAppContext();
  const [selectedAircraft, setSelectedAircraft] = useState(null);

  const handleAircraftUpdate = (updatedAircraft) => {
    setAircraftList(aircraftList.map(aircraft => 
      aircraft.id === updatedAircraft.id ? updatedAircraft : aircraft
    ));
    setSelectedAircraft(updatedAircraft);
  };

  const handleAddAircraft = () => {
    const newAircraft = {
      id: `aircraft${Date.now()}`,
      registration: '',
      type: '',
      maintenanceStatus: 'Serviceable',
      totalHours: 0,
    };
    setAircraftList([...aircraftList, newAircraft]);
    setSelectedAircraft(newAircraft);
  };

  const handleDeleteAircraft = (aircraftId) => {
    if (window.confirm('Are you sure you want to delete this aircraft?')) {
      setAircraftList(aircraftList.filter(aircraft => aircraft.id !== aircraftId));
      setSelectedAircraft(null);
    }
  };

  return (
    <div className="main-content">
      <div className="content-container">
        <div className="header">
          <h1>Aircraft Management</h1>
          <button className="new-booking-btn" onClick={handleAddAircraft}>
            + Add New Aircraft
          </button>
        </div>
        <div className="aircraft-grid">
          <div className="aircraft-list">
            {aircraftList.map(aircraft => (
              <div 
                key={aircraft.id} 
                className={`aircraft-item ${selectedAircraft?.id === aircraft.id ? 'selected' : ''}`}
                onClick={() => setSelectedAircraft(aircraft)}
              >
                <div className="aircraft-registration">{aircraft.registration}</div>
                <div className="aircraft-type">{aircraft.type}</div>
              </div>
            ))}
          </div>
          
          {selectedAircraft && (
            <div className="aircraft-details">
              <div className="details-header">
                <h2>Aircraft Details</h2>
                <button 
                  className="delete-btn"
                  onClick={() => handleDeleteAircraft(selectedAircraft.id)}
                >
                  Delete Aircraft
                </button>
              </div>
              <form className="details-form">
                <div className="form-group">
                  <label>Registration:</label>
                  <input
                    type="text"
                    value={selectedAircraft.registration}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      registration: e.target.value.toUpperCase()
                    })}
                  />
                </div>
                
                <div className="form-group">
                  <label>Type:</label>
                  <input
                    type="text"
                    value={selectedAircraft.type}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      type: e.target.value
                    })}
                  />
                </div>

                <div className="form-group">
                  <label>Maintenance Status:</label>
                  <select
                    value={selectedAircraft.maintenanceStatus}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      maintenanceStatus: e.target.value
                    })}
                  >
                    <option value="Serviceable">Serviceable</option>
                    <option value="Unserviceable">Unserviceable</option>
                    <option value="Maintenance">In Maintenance</option>
                  </select>
                </div>

                <div className="form-group">
                  <label>Total Hours:</label>
                  <input
                    type="number"
                    value={selectedAircraft.totalHours}
                    onChange={(e) => handleAircraftUpdate({
                      ...selectedAircraft,
                      totalHours: parseFloat(e.target.value) || 0
                    })}
                  />
                </div>
              </form>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Aircraft;
